import React from "react";
import styled from "styled-components";
import Fade from "react-reveal/Fade";
import {Link} from "react-scroll";
import debutant from "../Assets/debutant.JPG";

import Soups from "./MenuItems/Soups";
import Sandwich from "./MenuItems/Sandwich";
import Entree from "./MenuItems/Entree";
import AlaCarte from "./MenuItems/AlaCarte";
import Desserts from "./MenuItems/Desserts";

const MenuUpdated = () =>{

    return(
        <>
        <Wrapper>
            <MenuSection>
                <LinkTo to="soups" smooth={true} duration={10}>Soupes</LinkTo>
                <Link to="entree" smooth={true} duration={10}>Entr&eacute;e</Link>
                <Link to="sandwich" smooth={true} duration={10}>Sandwichs</Link>
                <Link to="aLaCarte" smooth={true} duration={10}>&Agrave; la carte</Link>
                <Link to="desserts" smooth={true} duration={10} >Desserts</Link>
</MenuSection>

            <Fade>
            <Soups/>
            <Sandwich/>
            <Entree/>
            <AlaCarte/>
            <Desserts/>
            </Fade>
            </Wrapper></>
    )
}

export default MenuUpdated;

const Wrapper = styled.div``;
const LinkTo = styled(Link)`
cursor: pointer;
`;
const MenuSection = styled.div``;
